import styled from "styled-components";

export const ContentList = styled.div`
    width: 100%;
    border: 1px solid green;

    h3 {
        font-size: 20px;
        font-weight: bold;
        color: gray;
        margin-left: 14px;
    }

    .boxWrap {
        width: 80%;
        
        .img {
            width: 100%;
            height: 50px;
            background-color: gray;
        }

        .username {
            width: 100%;
            font-size: 20px;
            color: gray
        }


    }

    .desc {
        width: 80%;
        color : blue;
    }
`
